import React from 'react';
import backgroundImg from 'https://res.cloudinary.com/dzcrtuhn5/image/upload/v1691175890/unicef-empowering-orphans-inspiring-hope-courtesy_srfnrg.jpg';

const Homepage = () => {
  return (
    <div className="hero-section" style={{ backgroundImage: `url(${backgroundImg})` }}>
      <div className="middle-content">
        <h1>Welcome to Our Orphanage Finder</h1>
        <button>Orphanage Finder</button>
      </div>
    </div>
  );
}

export default Homepage;
